import React from 'react';
import VideoCall from './components/VideoCall';
import Games from './components/Games';
import Settings from './components/Settings';

function App() {
  return (
    <div>
      <h1>Welcome to Anubhav Meet!</h1>
      <VideoCall />
      <Games />
      <Settings />
    </div>
  );
}

export default App;
